import React, { useState, useEffect } from 'react';
import Fuse from 'fuse.js';
import './index.css';

function SchoolwiseInterval() {
    const [intervalData, setIntervalData] = useState([]);
    const [selectedIntervals, setSelectedIntervals] = useState(null);
    const [activeSchool, setActiveSchool] = useState(null);  // To track the active school
    const [query, setQuery] = useState('');

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:4300/get-interval');
                if (response.ok) {
                    const data = await response.json();
                    setIntervalData(data);
                } else {
                    throw new Error('Network response was not ok.');
                }
            } catch (error) {
                console.error('Error fetching data: ', error);
            }
        };

        fetchData();
    }, []);

    const fuse = new Fuse(intervalData, {
        keys: ['schoolname', 'eiin'],
        includeScore: true
    });

    const handleSearch = (school) => {
        if (activeSchool === school) {
            // If the same school is clicked again, toggle it off
            setActiveSchool(null);
            setSelectedIntervals(null);
        } else {
            setActiveSchool(school);
            setQuery(school);
            const results = fuse.search(school);
            const matches = results.map(result => result.item);
            setSelectedIntervals(matches);
        }
    };

    return (
        <div className="container mt-5">
            <input
                type="text"
                className="form-control mb-3"
                placeholder="Search by school name or EIIN..."
                value={query}
                onChange={(e) => handleSearch(e.target.value)}
            />

            <ul className="list-group">
                {intervalData.map((item, index) => {
                    const schoolInfo = `${item.schoolname} (EIIN: ${item.eiin})`;
                    return (
                        <li key={index}
                            className={`list-group-item list-group-item-action list-group-item-primary ${activeSchool === schoolInfo ? 'active' : ''}`}
                            onClick={() => handleSearch(schoolInfo)}>
                            {schoolInfo}
                        </li>
                    );
                })}
            </ul>

            {selectedIntervals && selectedIntervals.length > 0 && activeSchool && (
                <div className="mt-4">
                    <table className="table table-striped">
                        <thead>
                            <tr>
                                <th>#</th>
                                <th>School Name</th>
                                <th>PC Name</th>
                                <th>Start Time</th>
                                <th>Last Time</th>
                                <th>Total Time (s)</th>
                                <th>Lab Number</th>
                                <th>PC Number</th>
                                <th>EIIN</th>
                            </tr>
                        </thead>
                        <tbody>
                            {selectedIntervals.map((item, index) => (
                                <tr key={index}>
                                    <td>{index + 1}</td>
                                    <td>{item.schoolname}</td>
                                    <td>{item.pcname}</td>
                                    <td>{item.starttime}</td>
                                    <td>{item.lasttime}</td>
                                    <td>{item.totaltime}</td>
                                    <td>{item.labnum}</td>
                                    <td>{item.pcnum}</td>
                                    <td>{item.eiin}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
}

export default SchoolwiseInterval;
